#!/usr/bin/env python3

# Write a function to process dna string


def wrap(seq, size):
	size = 60
	seq = seq.replace('\n','')
	readable_seq = ''
	total_seq = len(seq)
	for start in range(0,total_seq, size):
		if start+size < total_seq:
			readable_seq += seq[start:(start+size)] + '\n'
			start += size
		else:
			readable_seq += seq[start:total_seq]
	return readable_seq


